import React from "react";
import { connect } from "react-redux";
import { NavLink } from "react-router-dom";
import {
  defaultRoute,
  settingsRoute,
  profiledRoute,
  dashboardRoute,
  loginRoute
} from "../../config/route";
const Header = props => {
  console.log("Header%%%%%%%%%%%%%%%%%");
  return (
    <header className="header">
      <NavLink to={defaultRoute}>Profile</NavLink>
      <NavLink to={settingsRoute}>Setting</NavLink>
      <NavLink to={dashboardRoute}>Dashboard</NavLink>
      <NavLink to={loginRoute}>Login</NavLink>
    </header>
  );
};

const mapStateToProps = state => {
  console.log(
    "[Header@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@@]",
    state.authentication
  );
  return { isLogin: state.authentication.isSessionActive };
};

export default connect(mapStateToProps)(Header);
